(function() {
  const container = document.getElementById('vexflow_svg-output');
  if (!container) return;
  container.innerHTML = '';

  const { Renderer, Stave, StaveNote, Voice, Formatter, Tuplet, Beam } = Vex.Flow;

  const renderer = new Renderer(container, Renderer.Backends.SVG);
  const canvasWidth = 800;
  const canvasHeight = 200;
  renderer.resize(canvasWidth, canvasHeight);
  const context = renderer.getContext();
  context.scale(0.9, 0.9);

  const stave = new Stave(10, 40, 700);
  stave.addClef('treble');
  stave.setContext(context);
  stave.draw();

  const note_0 = new StaveNote({ keys: ['C/4'], duration: 'q' });
  const note_1 = new StaveNote({ keys: ['D/4'], duration: 'q' });
  const note_2 = new StaveNote({ keys: ['E/4'], duration: 'q' });
  const note_3 = new StaveNote({ keys: ['F/4'], duration: 'q' });
  const note_4 = new StaveNote({ keys: ['G/4'], duration: 'q' });
  // Create voice and add notes
  const voice_0 = new Voice({ num_beats: 4, beat_value: 4, resolution: Vex.Flow.RESOLUTION });
  voice_0.setStrict(false);
  voice_0.addTickables([note_0, note_1, note_2, note_3, note_4]);

  // Format and draw
  const formatter = new Formatter().joinVoices([voice_0]);
  formatter.format([voice_0], 600);
  voice_0.draw(context, stave);

})();

